import React from 'react'
import Card from './Card';
import data from '../moviesData';


function movieList() {
    return (

        <div style={{display: "flex" , justifyContent: "space-around"}}>
          { data.map((el,i)=>(
            <Card key={i} movie={el}/>))
        }  
        </div>
    )
}

export default movieList
